INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649235','Administrator',1158578649235,1165933047953,1,'','','LISTS also contain other nodes, but display them in a list/table','Pressing the ''L'' key will create a LIST VIEW icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649345','Administrator',1158578649345,1165933047469,2,'','','MAPS contain other nodes, and show the network structure -- such as this example','Pressing the ''M'' key will create a MAP VIEW icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649454','Administrator',1158578649454,1165933046969,3,'','','This is an ISSUE or QUESTION that you are thinking about','Pressing the ''Q'', ''?'' or ''I'' key will create an ISSUE/QUESTION icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649548','Administrator',1158578649548,1165933047641,7,'','','Use a CON to express a challenging argument','Pressing the " - " (minus) key will create a CON icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649673','Administrator',1158578649673,1165933047250,2,'','','What kinds of Reference nodes might one link to? (Double click to open this map)','',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649782','Administrator',1158578649782,1165933047563,4,'','','This is an IDEA which responds to an Issue. The asterisk shows there is detail text inside the node. Click on it to view.','Pressing the ''!'', ''A'' or ''P'' key will create an IDEA icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649907','Administrator',1158578649907,1165933047813,5,'','','Use an ARGUMENT to show support for one idea but challenging another (drag off the plus or minus)','Pressing the ''U'' key will create a ARGUMENT icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578649985','Administrator',1158578649985,1165933048016,10,'','','All of these nodes are "transcluded" into 2 other views. Roll over the digit in the lower right to view the navigation menu which will take you to these other views','',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578650079','Administrator',1158578650079,1165933047063,10,'','','This is a NOTE for misc. comments','Pressing the ''N'' key will create a NOTE icon on the screen where your mouse is located.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578650173','Administrator',1158578650173,1165933047313,6,'','','Use a PRO to express a supporting argument ','Pressing the ''+'' key will create a PRO icon on the screen where your mouse is located.\n\nNote:  You do NOT have to hold down the SHIFT button while pressing the ''+'' key.  Compendium knows that when you type a ''='' you want a ''+''.',0,'Administrator')
INSERT INTO Node (NodeID, Author, CreationDate, ModificationDate, NodeType, OriginalID, ExtendedNodeType, Label, Detail, CurrentStatus, LastModAuthor) VALUES ('137108251921158578650251','Administrator',1158578650251,1165933047734,8,'','','Make an IDEA into a DECISION node to show commitment (right-click)','Pressing the ''D'' key will create a DECISION icon on the screen where your mouse is located.',0,'Administrator')
